CREATE temporary table BBB(insnoh int, insdth date, insedth date, prjcdh nvarchar(15), phsh nvarchar(15), clsh nvarchar(15), bldh nvarchar(15), ownh nvarchar(15),  
PRIMARY KEY (insnoh, insdth, insedth, prjcdh)); 

INSERT INTO BBB(insnoh, insdth, insedth, prjcdh, phsh, clsh, bldh, ownh) 
SELECT InsH_No, InsH_Dt, InsH_Edt, Prj_Cd, Phs_Cd, Cls_Cd, InsH_Bld, InsH_Own 
FROM insentryH WHERE Prj_Cd=prjcd AND Phs_Cd=phs AND Cls_Cd=cls AND InsH_Bld=bld AND InsH_Own=own AND InsH_Cancelled='0' order by InsH_No desc limit 1;

SELECT D.InsD_Id,D.InsD_Code,D.InsD_Name,D.InsD_Prg,D.InsD_Com FROM insentryD D 
INNER JOIN BBB B on D.InsD_No=B.insnoh and D.InsD_Dt=B.insdth and D.InsD_Edt=B.insedth AND D.Prj_Cd=B.prjcdh and D.Phs_Cd=B.phsh AND D.Cls_Cd=B.clsh and D.InsD_Bld=B.bldh and D.InsD_Own=B.ownh 
WHERE D.Prj_Cd=prjcd AND Phs_Cd=phs AND Cls_Cd=cls AND InsD_Bld=bld AND InsD_Own=own order by D.insD_Id;
END ;;
