CREATE DEFINER=`root`@`localhost` PROCEDURE `UDSP_ProgDetailRpt`(dt date, phs nvarchar(15), cls nvarchar(15), prj nvarchar(15), 
mst nvarchar(15), zon nvarchar(15), sec nvarchar(15), typ nvarchar(15), own nvarchar(15), bld nvarchar(15), cnl int, sortby nvarchar(50))
BEGIN
SET @sql= NULL;
SET @condition ='';
SET SESSION group_concat_max_len=15000;

IF dt IS NOT NULL THEN SET @condition = concat(" where", ' H.InsH_Edt =''',dt,''''); END IF;
IF phs <> '' THEN SET @condition = concat(@condition, ' and H.Phs_Cd = ''', phs,''''); END IF;
IF cls <> '' THEN SET @condition = concat(@condition,  ' and H.Cls_Cd =''',cls,''''); END IF;
IF prj <> '' THEN SET @condition = concat(@condition,  ' and H.Prj_Cd =''',prj,''''); END IF;
IF mst <> '' THEN SET @condition = concat(@condition,  ' and B.Mst_Cd =''',mst,''''); END IF;
IF zon <> '' THEN SET @condition = concat(@condition,  ' and B.Zon_Cd =''',zon,''''); END IF;
IF sec <> '' THEN SET @condition = concat(@condition,  ' and B.Sec_Cd =''',sec,''''); END IF;
IF typ <> '' THEN SET @condition = concat(@condition,  ' and B.Typ_Cd =''',typ,''''); END IF;
IF own <> '' THEN SET @condition = concat(@condition,  ' and H.InsH_Own =''',own,''''); END IF;
IF bld <> '' THEN SET @condition = concat(@condition,  ' and H.InsH_Bld =''',bld,''''); END IF;
IF cnl <> '1' THEN SET @condition = concat(@condition,  ' and H.InsH_Cancelled =''',cnl,''''); 
	ELSE SET @condition = @condition; 
END IF;

SET @sql = CONCAT('SELECT H.InsH_No DocNo, H.InsH_Dt DocDt, H.InsH_Edt DocEdt, H.Prj_Cd Prj, H.Phs_Cd Phs, E.Phs_Name PhsName, H.Cls_Cd Cls, C.Cls_Name ClsName, H.InsH_Bld Bld, O.Own_Name Own, 
		B.Mst_Cd Mst, B.Zon_Cd Zon, B.Sec_Cd Sec, B.Typ_Cd Typ, B.Cns_Cd Cns, B.Unit Unt, B.Mode Mdl, H.InsH_Cancelled Cancel, 
        D.InsD_Id id, D.InsD_Code cd, D.InsD_Name nm, D.InsD_Prg prg, D.InsD_Com com 
		FROM insentryh H 
        inner join insentryd D on H.InsH_No=D.InsD_No and H.InsH_Dt=D.InsD_Dt and H.InsH_Edt=D.InsD_Edt and H.Prj_Cd=D.Prj_Cd and H.Phs_Cd=D.Phs_Cd and H.Cls_Cd=D.Cls_Cd 
		left join buildm B on H.Prj_Cd=B.Prj_Cd and H.InsH_Bld=B.Bld_Cd 
		left join ownm O on H.Prj_Cd=B.Prj_Cd and H.InsH_Own=O.own_Cd 
		left join phasem E on H.Prj_Cd=E.Prj_Cd and H.Phs_Cd=E.Phs_Cd
		left join classm C on H.Prj_Cd=C.Prj_Cd and H.Cls_Cd=C.Cls_Cd ', @condition , '
         Order by H.Phs_Cd, ', sortby );
        
PREPARE stmt FROM @sql;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;
END ;;
