CREATE DEFINER=`root`@`localhost` PROCEDURE `UDSP_ProgSummaryRpt`(phs nvarchar(15), cls nvarchar(15), frmdt date , todt date,
prj nvarchar(15), mst nvarchar(15), zon nvarchar(15), sec nvarchar(15), typ nvarchar(15), own nvarchar(15), bld nvarchar(15), 
cnl int, sortby nvarchar(50))
BEGIN
SET @sql = NULL;
SET @condition ='';
SET SESSION group_concat_max_len=15000;

IF phs <> '' THEN SET @condition = concat(" where", ' H.Phs_Cd = ''', phs,''''); END IF;
IF cls <> '' THEN SET @condition = concat(@condition,  ' and H.Cls_Cd =''',cls,''''); END IF;
IF frmdt IS NOT NULL AND todt IS NOT NULL THEN SET @condition = concat(@condition,  ' and H.InsH_Edt between ''',frmdt,''' and ''' ,todt,''''); 
	ELSEIF frmdt IS NOT NULL AND todt IS NULL THEN SET @condition = concat(@condition,  ' and H.InsH_Edt =''',frmdt,''''); 
    ELSEIF todt IS NOT NULL AND frmdt IS NULL THEN SET @condition = concat(@condition,  ' and H.InsH_Edt =''',todt,''''); 
END IF;
IF prj <> '' THEN SET @condition = concat(@condition,  ' and H.Prj_Cd =''',prj,''''); END IF;
IF mst <> '' THEN SET @condition = concat(@condition,  ' and B.Mst_Cd =''',mst,''''); END IF;
IF zon <> '' THEN SET @condition = concat(@condition,  ' and B.Zon_Cd =''',zon,''''); END IF;
IF sec <> '' THEN SET @condition = concat(@condition,  ' and B.Sec_Cd =''',sec,''''); END IF;
IF typ <> '' THEN SET @condition = concat(@condition,  ' and B.Typ_Cd =''',typ,''''); END IF;
IF own <> '' THEN SET @condition = concat(@condition,  ' and H.InsH_Own =''',own,''''); END IF;
IF bld <> '' THEN SET @condition = concat(@condition,  ' and H.InsH_Bld =''',bld,''''); END IF;
IF cnl <> '1' THEN SET @condition = concat(@condition,  ' and H.InsH_Cancelled =''',cnl,''''); 
	ELSE SET @condition = @condition; 
END IF;

SELECT
  GROUP_CONCAT(DISTINCT 
    CONCAT(
      'max(case when InsD_Code = ''',
      InsD_Code,
      ''' then InsD_Prg else "0.0" end) ',
      CONCAT("val",InsD_Id)
    ) order by InsD_Id
  ) INTO @sql
FROM
  insentryd where Phs_Cd=phs and Cls_Cd=cls;
SET @sql = CONCAT('SELECT H.InsH_No DocNo,H.InsH_Dt DocDt,H.InsH_Edt DocEdt,H.Prj_Cd Prj,H.Phs_Cd Phs,H.Cls_Cd Cls,H.InsH_Bld Bld,O.Own_Name Own,B.Mst_Cd Mst,
				B.Zon_Cd Zon,B.Sec_Cd Sec,B.Typ_Cd Typ,B.Cns_Cd Cns,B.Unit Unt,B.Mode Mdl,H.InsH_Cancelled Cancel, ', @sql, '
                  FROM insentryd D inner join insentryh H on D.InsD_No=H.InsH_No and D.InsD_Dt=H.InsH_Dt and D.InsD_Edt=H.InsH_Edt and D.Prj_Cd=H.Prj_Cd and
                  D.Phs_Cd=H.Phs_Cd and D.Cls_Cd=H.Cls_Cd
                  left join buildm B on H.Prj_Cd=B.Prj_Cd and H.InsH_Bld=B.Bld_Cd left join ownm O on H.Prj_Cd=B.Prj_Cd and H.InsH_Own=O.own_Cd ', @condition , '
                   GROUP BY H.InsH_No,H.InsH_Dt,H.InsH_Edt,H.Prj_Cd Order by ', sortby );

PREPARE stmt FROM @sql;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;
END ;;
DELIMITER ;
