CREATE DEFINER=`root`@`localhost` PROCEDURE `UDSP_ProgVarianceRpt`(dt date, phs nvarchar(15), cls nvarchar(15), prj nvarchar(15), 
mst nvarchar(15), zon nvarchar(15), sec nvarchar(15), typ nvarchar(15), own nvarchar(15), bld nvarchar(15), cnl int, sortby nvarchar(50))
BEGIN
DROP temporary table if exists AAA ;
CREATE temporary table AAA(Bld varchar(15),Typ varchar(15),FND decimal(10,2),SUP decimal(10,2),PRT decimal(10,2),KTC decimal(10,2),
SRD decimal(10,2),TIL decimal(10,2),WAL decimal(10,2),DR decimal(10,2),WND decimal(10,2),IPN decimal(10,2),
EPN decimal(10,2),WTP decimal(10,2),ELV decimal(10,2),MCH decimal(10,2),ELE decimal(10,2),OTH decimal(10,2)); 

INSERT into AAA(Bld,Typ,FND,SUP,PRT,KTC,SRD,TIL,WAL,DR,WND,IPN,EPN,WTP,ELV,MCH,ELE,OTH) Select D.PlnD_Bld Bld, 'P6 Progress' Typ,
max(CASE WHEN D.PlnD_Code='FND' THEN D.PlnD_Prg ELSE '0.00' END) DR,max(CASE WHEN D.PlnD_Code='SUP' THEN D.PlnD_Prg ELSE '0.00' END) ELE,
max(CASE WHEN D.PlnD_Code='PRT' THEN D.PlnD_Prg ELSE '0.00' END) ELV,max(CASE WHEN D.PlnD_Code='KTC' THEN D.PlnD_Prg ELSE '0.00' END) EPN,
max(CASE WHEN D.PlnD_Code='SRD' THEN D.PlnD_Prg ELSE '0.00' END) FND,max(CASE WHEN D.PlnD_Code='TIL' THEN D.PlnD_Prg ELSE '0.00' END) IPN,
max(CASE WHEN D.PlnD_Code='WAL' THEN D.PlnD_Prg ELSE '0.00' END) KTC,max(CASE WHEN D.PlnD_Code='DR' THEN D.PlnD_Prg ELSE '0.00' END) MCH,
max(CASE WHEN D.PlnD_Code='WND' THEN D.PlnD_Prg ELSE '0.00' END) OTH,max(CASE WHEN D.PlnD_Code='IPN' THEN D.PlnD_Prg ELSE '0.00' END) PRT,
max(CASE WHEN D.PlnD_Code='EPN' THEN D.PlnD_Prg ELSE '0.00' END) SRD,max(CASE WHEN D.PlnD_Code='WTP' THEN D.PlnD_Prg ELSE '0.00' END) SUP,
max(CASE WHEN D.PlnD_Code='ELV' THEN D.PlnD_Prg ELSE '0.00' END) TIL,max(CASE WHEN D.PlnD_Code='MCH' THEN D.PlnD_Prg ELSE '0.00' END) WAL,
max(CASE WHEN D.PlnD_Code='ELE' THEN D.PlnD_Prg ELSE '0.00' END) WND,max(CASE WHEN D.PlnD_Code='OTH' THEN D.PlnD_Prg ELSE '0.00' END) WTP 
from plnentryD D where D.PlnD_EDt=dt group by Bld order by Bld ASC;

INSERT into AAA(Bld,Typ,FND,SUP,PRT,KTC,SRD,TIL,WAL,DR,WND,IPN,EPN,WTP,ELV,MCH,ELE,OTH) Select D.InsD_Bld Bld, 'Owners Progress' Typ,
max(CASE WHEN D.InsD_Code='FND' THEN D.InsD_Prg ELSE '0.00' END) DR,max(CASE WHEN D.InsD_Code='SUP' THEN D.InsD_Prg ELSE '0.00' END) ELE,
max(CASE WHEN D.InsD_Code='PRT' THEN D.InsD_Prg ELSE '0.00' END) ELV,max(CASE WHEN D.InsD_Code='KTC' THEN D.InsD_Prg ELSE '0.00' END) EPN,
max(CASE WHEN D.InsD_Code='SRD' THEN D.InsD_Prg ELSE '0.00' END) FND,max(CASE WHEN D.InsD_Code='TIL' THEN D.InsD_Prg ELSE '0.00' END) IPN,
max(CASE WHEN D.InsD_Code='WAL' THEN D.InsD_Prg ELSE '0.00' END) KTC,max(CASE WHEN D.InsD_Code='DR' THEN D.InsD_Prg ELSE '0.00' END) MCH,
max(CASE WHEN D.InsD_Code='WND' THEN D.InsD_Prg ELSE '0.00' END) OTH,max(CASE WHEN D.InsD_Code='IPN' THEN D.InsD_Prg ELSE '0.00' END) PRT,
max(CASE WHEN D.InsD_Code='EPN' THEN D.InsD_Prg ELSE '0.00' END) SRD,max(CASE WHEN D.InsD_Code='WTP' THEN D.InsD_Prg ELSE '0.00' END) SUP,
max(CASE WHEN D.InsD_Code='ELV' THEN D.InsD_Prg ELSE '0.00' END) TIL,max(CASE WHEN D.InsD_Code='MCH' THEN D.InsD_Prg ELSE '0.00' END) WAL,
max(CASE WHEN D.InsD_Code='ELE' THEN D.InsD_Prg ELSE '0.00' END) WND,max(CASE WHEN D.InsD_Code='OTH' THEN D.InsD_Prg ELSE '0.00' END) WTP 
from insentryD D where D.InsD_EDt=dt group by Bld order by Bld ASC;

select A.*,O.Own_Name Own,B.Typ_Cd Typcd,B.Mode from AAA A 
left join buildm B on A.Bld=B.Bld_Cd left join ownm O on B.Own_cd=O.Own_Cd order by Bld,Typ desc;
END ;;
DELIMITER ;
