CREATE DEFINER=`root`@`localhost` PROCEDURE `UDSP_ProgVarRpt`(dt date, phs nvarchar(15), cls nvarchar(15), 
prjcd nvarchar(15), mstcd nvarchar(15), zoncd nvarchar(15), seccd nvarchar(15), ptyp nvarchar(15), owncd nvarchar(15), bldcd nvarchar(15), sortby nvarchar(50))
BEGIN
DECLARE cnt int default 0;
SET @sql= NULL;
SET @condition ='';
SET SESSION group_concat_max_len=15000;

IF dt IS NOT NULL THEN SET @condition = concat(" WHERE",  ' A.DocEdt =''',dt,''''); END IF;
IF prjcd <> '' THEN SET @condition = concat(@condition,  ' and B.Prj_Cd =''',prjcd,''''); END IF;
IF mstcd <> '' THEN SET @condition = concat(@condition,  ' and B.Mst_Cd =''',mstcd,''''); END IF;
IF zoncd <> '' THEN SET @condition = concat(@condition,  ' and B.Zon_Cd =''',zoncd,''''); END IF;
IF seccd <> '' THEN SET @condition = concat(@condition,  ' and B.Sec_Cd =''',seccd,''''); END IF;
IF ptyp <> '' THEN SET @condition = concat(@condition,  ' and B.Typ_Cd =''',ptyp,''''); END IF;
IF owncd <> '' THEN SET @condition = concat(@condition,  ' and B.Own_Cd =''',owncd,''''); END IF;
IF bldcd <> '' THEN SET @condition = concat(@condition,  ' and A.Bld =''',bldcd,''''); END IF;

DROP temporary table IF EXISTS AAA;
CREATE temporary table AAA(DocNo int, DocDt date, DocEdt date, prj varchar(15), phs varchar(15), cls varchar(15), Bld varchar(15), Typ varchar(15), 
	val1 decimal(10,2), val2 decimal(10,2), val3 decimal(10,2), val4 decimal(10,2), val5 decimal(10,2), val6 decimal(10,2), val7 decimal(10,2), val8 decimal(10,2), 
	val9 decimal(10,2),	val10 decimal(10,2), val11 decimal(10,2), val12 decimal(10,2), val13 decimal(10,2), val14 decimal(10,2), val15 decimal(10,2), val16 decimal(10,2),
    val17 decimal(10,2), val18 decimal(10,2), val19 decimal(10,2), val20 decimal(10,2), val21 decimal(10,2), val22 decimal(10,2), val23 decimal(10,2), val24 decimal(10,2), 
    val25 decimal(10,2), val26 decimal(10,2), val27 decimal(10,2), val28 decimal(10,2), val29 decimal(10,2), val30 decimal(10,2));
    /*, PRIMARY KEY (DocNo, DocDt, DocEdt, prj)); */
    	
SET cnt = (SELECT COUNT(InsH_No) FROM insentryh where InsH_Edt=dt AND Phs_Cd=phs AND Cls_Cd=cls);
IF cnt > 0 THEN
	SELECT GROUP_CONCAT(DISTINCT CONCAT('max(case when InsD_Code = ''', InsD_Code, ''' then InsD_Prg else "0.0" end) ',  CONCAT("val",InsD_Id)) ORDER BY InsD_Id) INTO @sql 
		FROM insentryd WHERE InsD_Edt=dt AND Phs_Cd=phs AND Cls_Cd=cls ORDER BY InsD_Bld ASC;

	IF phs='06C' AND cls='TP' THEN   
		SET @sql = CONCAT('SELECT InsD_No, InsD_Dt, InsD_Edt, Prj_Cd, Phs_Cd, Cls_Cd, InsD_Bld, "Owners Progress" Typ, ', @sql, '
							, "0.0" val22, "0.0" val23, "0.0" val24, "0.0" val25, "0.0" val26, "0.0" val27, "0.0" val28, "0.0" val29, "0.0" val30 
							FROM insentryd where InsD_Edt=''' ,dt, ''' and Phs_Cd=''' ,phs, ''' and Cls_Cd=''',cls,''' 
							GROUP BY InsD_Edt, Phs_Cd, Cls_Cd, InsD_Bld order by InsD_Bld ASC');
	ELSEIF  phs='07T' AND cls='TP' THEN
		SET @sql = CONCAT('SELECT InsD_No, InsD_Dt, InsD_Edt, Prj_Cd, Phs_Cd, Cls_Cd, InsD_Bld, "Owners Progress" Typ, ', @sql, '
							, "0.0" val13, "0.0" val14, "0.0" val15, "0.0" val16, "0.0" val17, "0.0" val18, "0.0" val19, "0.0" val20, "0.0" val21 
							, "0.0" val22, "0.0" val23, "0.0" val24, "0.0" val25, "0.0" val26, "0.0" val27, "0.0" val28, "0.0" val29, "0.0" val30 
							FROM insentryd where InsD_Edt=''' ,dt, ''' and Phs_Cd=''' ,phs, ''' and Cls_Cd=''',cls,''' 
							GROUP BY InsD_Edt, Phs_Cd, Cls_Cd, InsD_Bld order by InsD_Bld ASC');
	END IF;

	SET @sql = CONCAT('INSERT INTO AAA ( ',@sql,' )');
	PREPARE stmt FROM @sql;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
END IF;

SET cnt = 0;
SET @sql = NULL;
SET cnt = (SELECT COUNT(PlnD_No) FROM plnentryd WHERE PlnD_Edt=dt AND Phs_Cd=phs AND Cls_Cd=cls);
IF cnt > 0 THEN
	SELECT GROUP_CONCAT(DISTINCT CONCAT('max(case when PlnD_Code = ''', PlnD_Code, ''' then PlnD_Prg else "0.0" end) ',  CONCAT("val",PlnD_Id)) ORDER BY PlnD_Id) INTO @sql 
		FROM plnentryd WHERE PlnD_Edt=dt AND Phs_Cd=phs AND Cls_Cd=cls ORDER BY PlnD_Bld ASC;

	IF phs='06C' and cls='TP' THEN   
		SET @sql = CONCAT('SELECT PlnD_No, PlnD_Dt, PlnD_Edt, Prj_Cd, Phs_Cd, Cls_Cd, PlnD_Bld, "P6 Progress" Typ, ', @sql, '
							, "0.0" val22, "0.0" val23, "0.0" val24, "0.0" val25, "0.0" val26, "0.0" val27, "0.0" val28, "0.0" val29, "0.0" val30 
							FROM plnentryd where PlnD_Edt=''' ,dt, ''' and Phs_Cd=''' ,phs, ''' and Cls_Cd=''',cls,''' 
							GROUP BY PlnD_Edt, Phs_Cd, Cls_Cd, PlnD_Bld order by PlnD_Bld ASC');
	ELSEIF  phs='07T' AND cls='TP' THEN
		SET @sql = CONCAT('SELECT PlnD_No, PlnD_Dt, PlnD_Edt, Prj_Cd, Phs_Cd, Cls_Cd, PlnD_Bld, "P6 Progress" Typ, ', @sql, '
							, "0.0" val13, "0.0" val14, "0.0" val15, "0.0" val16, "0.0" val17, "0.0" val18, "0.0" val19, "0.0" val20, "0.0" val21 
							, "0.0" val22, "0.0" val23, "0.0" val24, "0.0" val25, "0.0" val26, "0.0" val27, "0.0" val28, "0.0" val29, "0.0" val30 
							FROM plnentryd where PlnD_Edt=''' ,dt, ''' and Phs_Cd=''' ,phs, ''' and Cls_Cd=''',cls,''' 
							GROUP BY PlnD_Edt, Phs_Cd, Cls_Cd, PlnD_Bld order by PlnD_Bld ASC');
	END IF;

	SET @sql = CONCAT('INSERT INTO AAA ( ',@sql,' )');
	PREPARE stmt FROM @sql;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
END IF;

SET @sql=NULL;
SET @sql = CONCAT('SELECT A.*, B.Mst_Cd Mst, B.Zon_Cd Zon, B.Sec_Cd Sec, B.Typ_Cd TypCd, B.Own_Cd, B.Cns_Cd Cns, B.Unit Unt, B.Mode Mdl, O.Own_Name Own FROM AAA A 
					LEFT JOIN buildm B ON A.prj=B.Prj_Cd AND A.Bld=B.Bld_Cd LEFT JOIN ownm O ON B.Prj_Cd=B.Prj_Cd AND B.Own_cd=O.Own_Cd ', @condition , ' ORDER BY ', sortby );
PREPARE stmt FROM @sql;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;
